var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': '每週練習內容', 'text': '學員出席 (10%) \n 個人倉儲與網站查驗 (20%) \n Task1: 參數式繪圖軟體 Solvespace 編譯、零組件繪圖與應用 (10%) \n Task2: MCAD 套件安裝與設定, 零組件繪圖、轉檔與 CAE 工程分析 (10%) \n Task3:\xa0 Rover 零組件轉入 \xa0 V-rep \xa0 與 \xa0 Webots \xa0 執行機電控制系統設計 (20%) \n Project:\xa0 機電資整合分組專案執行 (30%) \n 評分方式: \n 電腦輔助設計實習每週自評與互評表單: \xa0 https://forms.gle/raTtrfjv8cMMVSZd6 \xa0 \n 教學方式: \n 課堂講授 \n 操作錄影 \n 學員實習 \n 分組報告 \n 參考資料: \n https://open.umn.edu/opentextbooks/subjects/engineering \xa0 \n', 'tags': '', 'url': '每週練習內容.html'}, {'title': 'week2', 'text': '建立網站 \n 下載 2019Fall可攜套件.7z \n 相關指令 \n git submodule add 網址 \n python -m pip install flask_cors \n git config --global http.proxy [2001:288:6004:17::17]:3128 . \n', 'tags': '', 'url': 'week2.html'}, {'title': 'week3', 'text': '\n 實際操作 Solvespace \n 操作步驟 http://mde.tw/cad2019/content/Solvespace%20%E7%B7%A8%E8%AD%AF.html \n Solvespace 編譯說明 \n \n', 'tags': '', 'url': 'week3.html'}, {'title': 'week5', 'text': '\n . \n Solvespace 操作 \n http://mde.tw/cad2019/content/Solvespace%20%E6%93%8D%E4%BD%9C.html \n \n', 'tags': '', 'url': 'week5.html'}, {'title': 'week6', 'text': '繪製solvespace 之後匯出stl(格式是 Binary\xa0STL ) \n 在將 Solvespace 轉出的 Binary STL 零組件轉為 ASCII STL 程式碼 \n 網站 http://mde.tw/cad2019/content/STL.html \n <iframe width="600" height="400" src=" 你的檔案位置\xa0 \xa0 "></iframe> \n \n   stl \n 第一次使用小壁虎 \n 使車車移動 \n \n \n', 'tags': '', 'url': 'week6.html'}, {'title': 'week7', 'text': '分組網站統一規格 \n \n Solvespace 繪圖驗證, 從 零件網頁 \xa0 自選, 可採 Solvespace 完成繪圖的零件 \n \n https://youtu.be/1_Za7MP5pPY \n \n \n', 'tags': '', 'url': 'week7.html'}, {'title': 'week8', 'text': '利用leo程式修改正確的blog \n \n \n \n \n', 'tags': '', 'url': 'week8.html'}, {'title': 'week9', 'text': '期中報告blog 嵌入影片網址: \n https://s40723125.github.io/cad2019/blog/qi-zhong-bao-gao.html \n 期中報告影片 \n https://www.youtube.com/watch?v=alJZ0KpQz3E \n \n', 'tags': '', 'url': 'week9.html'}, {'title': 'week10', 'text': '建立小組倉儲 https://github.com/s40723125/cad2019ag5 \n 確認每個成員都有fork \n https://github.com/s40723125/cad2019ag5/network/members \n 這週有嘗試如何使用 pull requests \n 可惜用錯方式 \n \n', 'tags': '', 'url': 'week10.html'}, {'title': 'week12', 'text': '本週因merge出現問題弄很久，最後成功合併了 \n 可是出現merge後有些圖檔不見了，後來有使用git stash 之後不見得圖檔有回來了 \n', 'tags': '', 'url': 'week12.html'}, {'title': 'week13', 'text': '分配所有成員工作 \n nx3\xa0 nx12 \n http://mde.tw/cad2019/content/NX.html \n weborts \n http://mde.tw/cad2019/content/Webots.html \n', 'tags': '', 'url': 'week13.html'}, {'title': 'week15', 'text': '\n \n \n 心得: \n 從第10周開始處理分組網站外加NX12 、webots 、solvespace 、soildworks、v-rep 等程式每個都需要花時間去學習，要瞭解老師所提供的這些工具真的非常的難，像是裝可攜版的NX12就要佔掉20幾GB，加上我的USB才32GB，假如有機會買入隨身硬碟的話一定很方便。說真的老師教的webots導入 模主壤他跑起來真的很厲害。 \n \n \n ------------------------------------ \n 這禮拜的問題... \n \n \n \n \n \n', 'tags': '', 'url': 'week15.html'}, {'title': 'week16', 'text': '\n \n \n 心得: \n 這禮拜的小考好難啊，因為我都把 V-rep\xa0、webots 操作都丟給隊友去做導致我都不會，看來我要多認真學習，不要在分配工作了。 \n', 'tags': '', 'url': 'week16.html'}, {'title': 'week17', 'text': '\n \n \n 心得:把自走車畫好各部位零件後，利用solvespace組裝起來後，轉成stl直接宣告失敗原因不詳，只能說明我運氣不好或是不懂solvespace規則吧。 \n', 'tags': '', 'url': 'week17.html'}, {'title': '期末報告', 'text': '\n \n', 'tags': '', 'url': '期末報告.html'}]};